//SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

// Useful for debugging. Remove when deploying to a live network.
import "hardhat/console.sol";

/**
 * Contrato CoreWriter para hyperEVM testnet
 * Permite ejecutar acciones fijas y personalizadas para probar CoreWriter
 * @author Tu Nombre
 */
contract YourContract {
    // Estado del contrato
    address public immutable owner;
    uint256 public actionCounter = 0;
    mapping(uint256 => Action) public actions;
    mapping(address => uint256[]) public userActions;

    // Estructura para representar una acción
    struct Action {
        uint256 id;
        address creator;
        string actionType;
        bytes data;
        uint256 timestamp;
        bool executed;
        string result;
    }

    // Acciones fijas predefinidas
    enum FixedActionType {
        WRITE_DATA,
        READ_DATA,
        UPDATE_DATA,
        DELETE_DATA,
        BATCH_WRITE
    }

    // Eventos
    event ActionCreated(uint256 indexed actionId, address indexed creator, string actionType, uint256 timestamp);
    event ActionExecuted(uint256 indexed actionId, string result, uint256 timestamp);
    event CoreWriterCall(address indexed caller, string operation, bool success);

    // Modificador para el propietario
    modifier onlyOwner() {
        require(msg.sender == owner, "Solo el propietario puede ejecutar esta funcion");
        _;
    }

    // Constructor
    constructor(address _owner) {
        owner = _owner;
        console.log("Contrato CoreWriter desplegado por:", _owner);
    }

    /**
     * Crea una acción fija predefinida
     * @param _actionType Tipo de acción fija
     * @param _data Datos adicionales para la acción
     */
    function createFixedAction(FixedActionType _actionType, bytes calldata _data) public {
        string memory actionTypeString = _getFixedActionTypeString(_actionType);
        _createAction(actionTypeString, _data);
    }

    /**
     * Crea una acción personalizada
     * @param _actionType Tipo de acción personalizada
     * @param _data Datos de la acción
     */
    function createCustomAction(string calldata _actionType, bytes calldata _data) public {
        _createAction(_actionType, _data);
    }

    /**
     * Ejecuta una acción específica
     * @param _actionId ID de la acción a ejecutar
     */
    function executeAction(uint256 _actionId) public {
        require(_actionId < actionCounter, "Accion no existe");
        require(!actions[_actionId].executed, "Accion ya ejecutada");

        Action storage action = actions[_actionId];
        action.executed = true;

        // Simular ejecución de CoreWriter
        string memory result = _simulateCoreWriterExecution(action.actionType, action.data);
        action.result = result;

        emit ActionExecuted(_actionId, result, block.timestamp);
        emit CoreWriterCall(msg.sender, action.actionType, true);

        console.log("Accion ejecutada:", _actionId, "Resultado:", result);
    }

    /**
     * Ejecuta múltiples acciones en lote
     * @param _actionIds Array de IDs de acciones
     */
    function executeBatchActions(uint256[] calldata _actionIds) public {
        for (uint256 i = 0; i < _actionIds.length; i++) {
            executeAction(_actionIds[i]);
        }
    }

    /**
     * Obtiene todas las acciones de un usuario
     * @param _user Dirección del usuario
     * @return Array de IDs de acciones
     */
    function getUserActions(address _user) public view returns (uint256[] memory) {
        return userActions[_user];
    }

    /**
     * Obtiene información de una acción específica
     * @param _actionId ID de la acción
     * @return Información completa de la acción
     */
    function getAction(uint256 _actionId) public view returns (Action memory) {
        require(_actionId < actionCounter, "Accion no existe");
        return actions[_actionId];
    }

    /**
     * Función de prueba para CoreWriter - escritura de datos
     * @param _key Clave del dato
     * @param _value Valor del dato
     */
    function testCoreWriterWrite(string calldata _key, string calldata _value) public {
        bytes memory data = abi.encode(_key, _value);
        _createAction("CORE_WRITER_WRITE", data);

        // Simular escritura en CoreWriter
        console.log("CoreWriter Write - Key:", _key, "Value:", _value);
        emit CoreWriterCall(msg.sender, "WRITE", true);
    }

    /**
     * Función de prueba para CoreWriter - lectura de datos
     * @param _key Clave del dato a leer
     */
    function testCoreWriterRead(string calldata _key) public {
        bytes memory data = abi.encode(_key);
        _createAction("CORE_WRITER_READ", data);

        // Simular lectura desde CoreWriter
        console.log("CoreWriter Read - Key:", _key);
        emit CoreWriterCall(msg.sender, "READ", true);
    }

    /**
     * Función de prueba para CoreWriter - actualización de datos
     * @param _key Clave del dato
     * @param _newValue Nuevo valor
     */
    function testCoreWriterUpdate(string calldata _key, string calldata _newValue) public {
        bytes memory data = abi.encode(_key, _newValue);
        _createAction("CORE_WRITER_UPDATE", data);

        // Simular actualización en CoreWriter
        console.log("CoreWriter Update - Key:", _key, "New Value:", _newValue);
        emit CoreWriterCall(msg.sender, "UPDATE", true);
    }

    /**
     * Función de prueba para CoreWriter - eliminación de datos
     * @param _key Clave del dato a eliminar
     */
    function testCoreWriterDelete(string calldata _key) public {
        bytes memory data = abi.encode(_key);
        _createAction("CORE_WRITER_DELETE", data);

        // Simular eliminación en CoreWriter
        console.log("CoreWriter Delete - Key:", _key);
        emit CoreWriterCall(msg.sender, "DELETE", true);
    }

    /**
     * Función de prueba para CoreWriter - operación en lote
     * @param _operations Array de operaciones en formato JSON
     */
    function testCoreWriterBatch(string calldata _operations) public {
        bytes memory data = abi.encode(_operations);
        _createAction("CORE_WRITER_BATCH", data);

        // Simular operación en lote en CoreWriter
        console.log("CoreWriter Batch Operations:", _operations);
        emit CoreWriterCall(msg.sender, "BATCH", true);
    }

    // Funciones internas

    function _createAction(string memory _actionType, bytes memory _data) internal {
        uint256 actionId = actionCounter;

        actions[actionId] = Action({
            id: actionId,
            creator: msg.sender,
            actionType: _actionType,
            data: _data,
            timestamp: block.timestamp,
            executed: false,
            result: ""
        });

        userActions[msg.sender].push(actionId);
        actionCounter++;

        emit ActionCreated(actionId, msg.sender, _actionType, block.timestamp);
        console.log("Nueva accion creada:", actionId, "Tipo:", _actionType);
    }

    function _getFixedActionTypeString(FixedActionType _actionType) internal pure returns (string memory) {
        if (_actionType == FixedActionType.WRITE_DATA) return "FIXED_WRITE_DATA";
        if (_actionType == FixedActionType.READ_DATA) return "FIXED_READ_DATA";
        if (_actionType == FixedActionType.UPDATE_DATA) return "FIXED_UPDATE_DATA";
        if (_actionType == FixedActionType.DELETE_DATA) return "FIXED_DELETE_DATA";
        if (_actionType == FixedActionType.BATCH_WRITE) return "FIXED_BATCH_WRITE";
        return "UNKNOWN";
    }

    function _simulateCoreWriterExecution(string memory _actionType, bytes memory /* _data */) internal pure returns (string memory) {
        // Simulación de ejecución de CoreWriter
        if (bytes(_actionType).length > 0) {
            return string(abi.encodePacked("CoreWriter ejecutado exitosamente: ", _actionType));
        }
        return "Error en la ejecucion de CoreWriter";
    }

    /**
     * Función para recibir HYPE
     */
    receive() external payable {}

    /**
     * Función para retirar HYPE (solo propietario)
     */
    function withdraw() public onlyOwner {
        (bool success, ) = owner.call{value: address(this).balance}("");
        require(success, "Fallo al enviar HYPE");
    }
}

